　●車検対応●長寿命●省電力設計●信頼のCREE社製LED採用●Hi/Lo切り替え可能●取り付け簡単●いきなり明るい素早い点灯●バッテリーに優しい自動減光システム採用●入力電圧変化による光量変化がほとんどない●走行風による強制空冷タイプ●グレア（眩しさ）対策設計<br>
<br>
■仕様<br>
・定格電圧：DC12V<br>
・定格電流：2.3A<br>
・入力電力：28W<br>
・LED：CREE社製 XLamp XP-L LEDs 70-CRI White<br>
・色温度：5000ケルビン<br>
・最高光度：26,600カンデラ※車検適合基準値15,000カンデラ<br>
・減光時光度：10,000カンデラ以下<br>
<br>
■適合車種<br>
・'09～ ZRX1200 DAEG<br>
<br>
■注意事項<br>
<ul>
<li>本製品は、12v直流専用です。必ずDC12vを電源とした配線を厳守してください。※小排気量車に多い交流発電車両のヘッドライト配線への接続は絶対に行わないでください。</li>
<li>製品の特性上、発熱致します。取付けの際は、必ず走行時に風があたる様に確実に取り付けて下さい。また本製品を取付けた後も、定期的に増し締めなど確実に取付けられているか確認を行ってください。</li>
<li>停車時の発熱を抑える目的で減光する仕様となっている為、必ずタコメーター信号線を接続してご使用ください。</li>
<li>本製品は生活防水対策済みですが、ライト本体から出ている3Pヘッドライトカプラーとヘッドライトケース内に収まりきらないハーネスのカプラーを自己融着テープなどで防水処理をしてください。</li>
<li>高圧洗浄機による洗車を行う際は本製品に直接高圧洗浄が当たらないようにしてください。</li>
<li>本製品を使用中、少しでも異常を感じた場合は、お買い求めの販売店またはメーカーサービス課までお問い合わせください。</li>
<li>点灯中のLED発光面を直視しないでください。視覚障害の原因となります。</li>
<li>本体が熱を持った状態でメッキ部に水分が付着したまま長時間放置するとメッキが剥がれる恐れがあります。付着した水分は必ずを拭き取ってご使用ください。</li>
<li>LEDライト本体を落としたり、キズを付けたり、無理な力を加えないでください。破損、性能の低下、寿命を縮めるだけではなく、ケガの原因にもなります。</li>
<li>紙や布、ガソリン、可燃スプレー、シンナー等燃えやすい物や引火する危険のあるものの近くでは点灯しないでください。</li>
<li>ご使用前に必ず光軸の調整を行ってください。対向車の視界の妨げになり、交通事故を誘発する恐れがあります。</li>
<li>本製品の取付けをした事により車両製造メーカーの保証が受けられない場合があります。</li>
<li>本製品の使用により生じた故障・事故などの損害については、一切責任を負いかねます。あらかじめご了承ください。</li>
<li>修理の際に生じる脱着工賃やその他諸費用につきましては、一切責任を負いかねます。あらかじめご了承ください。</li>
</ul>
<br>
■取付け時の注意事項<br>
<ul>
<li>取付けについては熟練したメカニックのいる指定整備工場などで行ってください。</li>
<li>取り付け後は必ず光軸調整を行ってください。</li>
<li>詳しくは道路運送車両の保安基準を参照ください。</li>
</ul>
<br>
