<br>
高性能スクーターから高性能スポーツバイクまで幅広く対応したエンジンオイルで、高温・高負荷条件下において優れたエンジン性能と、ミッション性能を発揮します。特に、スポーツ走行及びレーシングコンディションなどの高温・高負荷時における湿式プレートに対する摩擦特性を適正化し、ピックアップ性能の向上を一つのポイントとし、高回転域における粘性抵抗の低減をコンセプトに開発された製品で、Moty's 独自の技術が可能にしたスムーズなミッションフィールに特徴があるレスポンス型レーシングオイルです。この製品は粘度温度特性に優れるハイドロカーボン系合成基油と、耐熱・溶解性に優れたエステル系合成基油を用い、更に摺動部分のせん断速度に対する柔軟な粘度追従を可能にする厳選された機能添加剤をバランスしています。<br>
