用途：<br>
成分：化学合成油<br>
<br>
主に高トルク高性能バイクに対応する製品で、M151の高レスポンス型に対して、超高温・高負荷条件下における連続長時間使用をコンセンプトに開発された耐久型レーシンングオイルです。エンジンに対する耐熱性・耐摩耗性に優れ且つ、湿式プレートに対する摩擦コントロールと、高い油膜・油圧保持性能を実現しています。そしてMoty's 独自の技術が可能とした過酷な運転条件下におけるスムーズなミッションフィールに、最大の特徴があります。ベースは耐熱性・溶解性、更には吸着性に優れた複数のエステル系合成基油をリッチな構成とし、Moty's 独自の機能添加剤バランスで仕上げた製品です。尚、この製品の特性でもある強靭な油膜の為、独特且つ重厚なフィーリングを呈します。これらをオーバークオリティーと感じる場合、M151の使用をお勧めします。<br>
